류화영 다리 부상>검진 결과 큰 이상 없음>그러나 일본에서 콘서트 1곡만 참여, 네일아트 받음> 이 사실을 안 티아라 멤버들이 화영에게 지적>류화영 나 몰라라: 여기까지는, "많이 아픈 것도 아닌데 네일아트를 받는 안일한 모습에 실망한 나머지 멤버"vs"아프니까 이해해줬으면 하는 화영" 간의 평범한 갈등이라고 볼 수 있음 ㅇㅇ 그래서 화영 본인도 왕따는 팩트가 아니라고 한거고 

문제는 여기서 류화영 언니인가? 이 사건을 가지고 티아라의 한 멤버에게 협박성 메시지를 날린게 문제가 된 거임 여기서 왕따가 날조 된 것이고 소속사가 대응을 잘못한 거고

 @철갑상어  무슨 12주동안 2위를 함? 롤폴 뮤뱅에서 1위 못한거 맞고 몇주간 1위후보 유지한것도 맞지만 그렇게 장기간 후보에 들지는 않았었음. 크라이크라이는 초반에는 원걸 소시에 후에는 아이유에 밀려서 3위가 최대 순위였고 
다음해에 나온 러비더비가 4번 1위하고 끝났었고 
티아라 경우에는 과거가 잊혀진게 아니고 미화되고 있는데 티아라가 소시 잡는다 만다 하는거는 팬들한테만 그런거지 그때 소녀시대는 여돌이랑은 어나더였고 웬만한 남돌이랑 붙어도 이기던 시절이었음

